function signInCallback(e){if(redirect_url=$.urlParam("redirect"),null==redirect_url&&(redirect_url="/"),e.code){$("#signinButton").attr("style","display: none");var r=$("#result").attr("data-loginstate");$.ajax({type:"POST",url:"/gconnect?state="+r,processData:!1,data:e.code,contentType:"application/octet-stream; charset=utf-8",success:function(r){r?window.location.href=redirect_url:e.error?console.log("There was an error: "+e.error):$("#result").html("Failed to make a server-side call. Check your configuration and console.")}})}}$.urlParam=function(e){var r=new RegExp("[?&]"+e+"=([^&#]*)").exec(window.location.href);return null==r?null:r[1]||0};